import React, { useState } from 'react';
import App from './App'; // Course Management
import StudentRegistration from './StudentRegistration';

function Main() {
  const [page, setPage] = useState('home');

  return (
    <div>
      <nav className="navbar navbar-dark bg-dark px-4 shadow-sm">
        <div className="container-fluid">
          {/* Empty div to keep space on the left if needed */}
          <div className="ms-auto">
            <div className="btn-group">
              <button
                className={`btn btn-outline-light ${page === 'home' ? 'active' : ''}`}
                onClick={() => setPage('home')}
              >
                Course Management
              </button>
              <button
                className={`btn btn-outline-light ${page === 'student' ? 'active' : ''}`}
                onClick={() => setPage('student')}
              >
                Student Registration
              </button>
            </div>
          </div>
        </div>
      </nav>

      {page === 'home' && <App />}
      {page === 'student' && <StudentRegistration />}
    </div>
  );
}

export default Main;
